Staying on top of the latest news about #COVID19, and sifting through information online, can be a challenge -- especially if you're a teenager.

How are public officials trying to reach #Vermont teens, and is their messaging working?

@annasvandine took a closer look

Covid, fun and Christmas - all wrapped up in a seasonal song! All proceeds go directly to Pieta House.  Any help you can give us would be greatly appreciated.     
